import * as types from './mutation-types';

const mutations = {
  [types.SET_POST_LIST](state, postList) {
    state.postList = postList;
  },
  [types.SET_POST_SUCCESS](state, postSuccess) {
    state.postSuccess = postSuccess;
  },
  [types.SET_POST_ERROR](state, postError) {
    state.postError = postError;
  },
  [types.SET_POST_DETAILS](state, postDetails) {
    state.postDetails = postDetails;
  },
};

export default mutations;
